insert into `vod_table_1`(`name`,`image`,`url`,`area`,`year`,`type`,`intro1`,`intro2`,`intro3`,`intro4`,`id`,`clickrate`,`recommend`,`chage`,`updatetime`,`firstletter`,`status`) values('大城小村第一季','http://tupian.tupianzy.com/pic/upload/vod/2019-03-20/201903201553090081.jpg','第01集#Hc8GBqFCT3nZzZpsMtM8BxYeKh1D3DlvF3MwMVkyz1sySSWoTQ94Vrd0Plk3CkV8NnKCzggl7ZkYd89eAN==|第02集#Hc8GBqFCT3nZzZpsMtM8BxYeKh1D3DlvF3MwMVkyz1sySSWbTQhYVrh0U8JQz1BfodPCzggl7ZkYd89eAN==|第03集#Hc8GBqFCT6Cwz9fYxt4q8bBvSeOVQ3nvFTjndJgYzkc8oeC5VrzwQnYpK59DXxcYKhhq7ZhvjVFXNH==','2','更早','005','明基·斯皮罗','明基·斯皮罗','莫兰·阿提艾斯,米凯拉·麦克曼努斯,Jerod Haynes,弗兰基·费森','《大城小村》由Mike Daniels开发及执笔，故事围绕曼哈顿的一栋公寓大厦里各种年龄﹑种族﹑文化和不同生活方式的住户，以及他们交织在一起，如大家庭般的生活。Michaela McManus饰演Sarah，一个很照顾人的护士，曾经是少女妈妈的她，现在女儿也重走旧路当了少女妈妈﹑Grace Van Dien饰演Katie，独立﹑聪慧﹑有个钥匙儿童（意指家长出去工作，独自在家、无人照看的孩子）的单亲妈妈，努力工作的她仅仅能维持生计。当艺术家和活动家的Katie被母亲Sarah视为在闹反叛，因此两人起了磨擦。Moran Atias饰演伊朗移民Edda，她被指控持有虚假公民文件而被移民海关执法局拘留﹑Jerod Haynes饰演当地警官Ben﹑Frankie Faison饰演热心助人的Ron。Warren Christie饰演前特种部队成员Nick，在服役时失去了他的腿；他回到曼哈顿的社区时，众人都不断感谢他，问题是他只想回到平常的生活。Daren Kagasoff饰演公寓看门人Gabe Deluca，Enzo的儿子。Lorraine Toussaint饰演Patricia，温柔﹑精力充沛的她被其他人视如祖母，当社工的她没有孩子，因此成了所有住户的照顾者。不过一直过着充实生活的Patricia，却在确诊癌症后反而找到平静的感受。Dominic Chianese饰演刚愎自用的Enzo，他希望离开疗养院与孙子一起住，问题是他虽然溺爱孙子，但又经常给对方吃苦头。','8','8','3','0','1554308760','dccdyj','0');
