insert into `vod_table_1`(`name`,`image`,`url`,`area`,`year`,`type`,`intro1`,`intro2`,`intro3`,`intro4`,`id`,`clickrate`,`recommend`,`chage`,`updatetime`,`firstletter`,`status`) values('恶行第一季','http://tupian.tupianzy.com/pic/upload/vod/2019-03-21/201903211553174300.jpg','第01集#Hc8GBqFCT3nZzZpsMtM8BxYeKh1D3DlvF3MwMVkyz1sySSWfTQ949l90Uvtjzkk3SrRCzggl7ZkYd89eAN==|第02集#Hc8GBqFCT3nZzZpsMtM8BxYeKh1D3DlvF3MwMVkyz1sySSWFTQ9fVQ90Ur7lApchNhWCzggl7ZkYd89eAN==|第03集#Hc8GBqFCT3GrjIDYdl4qHm40hhmqFTgkj3IyPrc8A1cQSnKCHV2gVe3UU8B6C5xhN1LwjpTn3EjwPbJf|第04集#Hc8GBqFCT3GrjIDYdl4qHm40hhmqFTgkj3IyPrc8A1cGSqPCVVNPVQp0Nh7kC4xfFeaCzggl7ZkYd89eAN==','2','更早','005','Laure de Clermont-Tonnerre','Laure de Clermont-Tonnerre','乔伊·金,帕特丽夏·阿奎特,科洛·塞维尼,安娜索菲亚·罗伯','Hulu正式预订真实罪案诗选剧《恶行 The Act》，该剧由Nick Antosca（《零异频道 Channel Zero》主创）和Michelle Dean创作﹑首季由Laure de Clermont-Tonnerre负责执导。本剧的每一季都将聚焦于一起特殊的案件，首季将根据Michelle Dean在Buzzfeed上发表的真实故事文章《Dee Dee Wanted Her Daughter To Be Sick, Gypsy Wanted Her Mom To Be Murdered》改编，这讲述了48岁单亲妈妈Dee Dee Blanchard跟周遭人说自己的女儿Gypsy患了多种重疾（例如脑损伤而失智﹑白血病﹑哮喘等），但实际上没人知道，Gypsy根本是个健康得不得了的成人；后来Dee Dee身中多刀死亡，她的邻居们﹑亲人及警方发现是被虐待的Gypsy说服她男友杀害了母亲。Patricia Arquette饰演母亲Dee Dee，在外人眼中她是完美母亲；为了照顾「重疾」女儿Gypsy她历尽艰苦，还曾无家可归及经历卡特里娜飓风，所以在密苏里州的Springfield社区中，Dee Dee可谓是榜样。Joey King饰演被限制在轮椅上的Gypsy，正试图反抗母亲。Chloë Sevigny饰演领导社区女性的Mel，有着艰苦生活的她很同情Dee Dee，但当她发现真相时只能目瞪口呆﹑AnnaSophia Robb饰演Mel的女儿Lacey，她像母亲一般受社区欢迎，不过她想法上相对较理想主义。Lacey很快被Dee Dee及Gypsy所吸引，并想帮助她们。Calum Worthy饰演Nick，Gypsy在基督教约会网遇到他。Michelle Dean的文章在Buzzfeed上迅速走红，自发布起获得了超400万的阅读量，被Longform列入2016年十大网文。','13','72','2','0','1554308097','exdyj','0');
