'张铭恩,文咏珊,魏千翔,汤梦佳','高洁梦想成为珠宝设计师，远赴南美矿场工作，和盛丰金饰继承人于直浪漫邂逅。回国后的高洁事业受阻，为了继续自己的梦想，高洁进入盛丰。盛丰是国内老牌的金饰企业，但碍于西式珠宝品牌的冲击逐渐式微。为了振兴盛丰，于直大胆突破传统业务，成立镶嵌组主打西式珠宝。高洁进入盛丰后，逐渐发现中国传统工艺首饰之美，奠定自己中西合璧的设计风格，同时影响于直萌发了革新并发扬中国传统工艺的想法。但是原本相爱的两人因为于直继母穆子昀是高洁的表姨而遗憾分手。而后穆子昀收购盛丰，登上董事长宝座。于直不甘放弃，自主创办匠之艺。高洁做出了结合中国传统工艺和环保理念的设计创新，在国际大赛上夺得冠军。高洁加入匠之艺，和于直携手将中国传统工艺首饰焕发出新的活力，重新树立起盛丰的招牌。而两人终得眷属。','18','85','5','0','1554307878','zwyjn','0');
